    )
}

const TrendingItem: React.FC = () => {
    return (
        <></>
    )
}

const Follow: React.FC = () => {
    return (
        <></>
    )
}

const FollowUser: React.FC = () => {
    return (
        <></>
    )
}

export default Explore;
